code_brute_force.code:
class Solution:

    def minOperations(self, nums: List[int], queries: List[int]) -> List[int]:
        result = []
        for query in queries:
            operations = 0
            for num in nums:
                operations += abs(num - query)
            result.append(operations)
        return result

data_validator.code:
def is_valid_input(nums: List[int], queries: List[int]) -> bool:
    if not 1 <= len(nums) <= 10 ** 5:
        return False
    if not 1 <= len(queries) <= 10 ** 5:
        return False
    for num in nums:
        if not 1 <= num <= 10 ** 9:
            return False
    for query in queries:
        if not 1 <= query <= 10 ** 9:
            return False
    return True

