def random_test(n_max: int, m_max: int, num_max: int, query_max: int) -> List[tuple]:

    def gen_input() -> tuple:
        while True:
            n = random.randint(1, n_max)
            m = random.randint(1, m_max)
            nums = [random.randint(1, num_max) for _ in range(n)]
            queries = [random.randint(1, query_max) for _ in range(m)]
            if is_valid_input(nums, queries):
                return (nums, queries)
    random_inputs = [gen_input() for _ in range(5)]
    return random_inputs

